let reducer=(state=initdata,action)=>{
   if(action.type==success){
      return {
         ...state,
         presentdata:action.payload
      }
   }
   if(action.type==login){
      return {
         ...state,
         isAuth:true
      }
   }
    return state
}

export {reducer}
 
 
